import styled from 'styled-components';

const CallsBorder = styled.div`
overflow: hidden;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 25%;
width: 20%;
height: 240px;

border-right: 2px solid black;
`
const RideName = styled.div`
text-align: center;
font-size: 30px;
`

const PauseButton = styled.button`
margin-top: 70px;
margin-left: 20px;
justify-content: center;
height: 17%;
width: 85%;
border: 2px solid black;
background: transparent;
`
const EndButton = styled.button`
margin-top: 2px;
margin-left: 20px;
justify-content: center;
height: 17%;
width: 85%;
border: 2px solid black;
background: transparent;
`
const AddIntervalsBorder = styled.tr`
overflow: hidden;
background: transparent;
margin: 15px 0px;
position: absolute;
left: 45%;
width: 44%;
height: 240px;
border: 3px solid blue;
`;

const Interval = styled.td`
background: transparent;
height: 100%;
position: absolute;
left: 39%;
width: 300px;
border-right: 2px solid black;
`;

const Time = styled.td`
padding-left: 50px;
background: transparent;
height: 35px;
font-size: 22px;
width: 300px;
border-bottom: 2px solid black;
`;

const Collect = styled.td`
padding-left: 50px;
text-align: left;
background: transparent;
height: 55px;
font-size: 18px;
width: 300px;
border-bottom: 2px solid black;
position:absolute;
top: 35px;
`;

const Starting = styled.td`
padding-left: 50px;
text-align: left;
background: transparent;
height: 55px;
font-size: 18px;
width: 300px;
border-bottom: 2px solid black;
position:absolute;
top: 88px;
`;

const Ending = styled.td`
padding-left: 50px;
text-align: left;
background: transparent;
height: 55px;
font-size: 18px;
width: 300px;
position:absolute;
top: 143px;
`;
const AttractionIntervals = () => {
    return (
        <>

            <CallsBorder>
                <RideName>The Joker</RideName>
                <PauseButton> Pause Calls </PauseButton>
                <EndButton> End Todays Calls </EndButton>
            </CallsBorder>

            <AddIntervalsBorder>


            </AddIntervalsBorder>

        </>
    )
}

export default AttractionIntervals
